import React from "react";
import { FC } from "react";

interface ReviewProps {
  title: string;
  datePosted: number;
  rating: number;
  review: string;
}
const Review: FC<ReviewProps> = ({ title, datePosted, rating, reviews }) => {
  return (
    <div>
      <h2>{title}</h2>
      <h3>{rating}</h3>
      <p>{datePosted}</p>
      <p>{review}</p>
    </div>
  );
};

export default Review;
